import React from 'react'
import HomePage from "./pages/HomePage";
import IntroductionPage from "./pages/IntroductionPage";
import FactoryPage from "./pages/FactoryPage";
import DesignPage from "./pages/DesignPage";
import SampleDesignPage from "./pages/SampleDesignPage";
import ContactPage from "./pages/ContactPage";

const routes = [
    {
        path: '/',
        exact: true,
        main: () => <HomePage/>
    },
    {
        path: '/introduction',
        exact: true,
        main: () => <IntroductionPage/>
    },
    {
        path: '/factory',
        exact: true,
        main: () => <FactoryPage/>
    },
    {
        path: '/design',
        exact: true,
        main: () => <DesignPage/>
    },
    {
        path: '/construction',
        exact: true,
        main: () => <construction/>
    },
    {
        path: '/sample-design',
        exact: true,
        main: () => <SampleDesignPage/>
    },
    {
        path: '/contact',
        exact: true,
        main: () => <ContactPage/>
    }
];

export default routes;
